	@Override
	protected void addValue() {
	
		//annotationEntity.setValue("value");
	}
	
	private int offsetValue = 0;
	private int lengthValue = 0;

	private boolean brackets = true;
	
	private int previousState = 0;
	
	private void readEntity(int nextState, boolean cutLeftEdge, boolean cutRightEdge) {
	
		offset = 0;
		length = yylength();
		
		if(cutLeftEdge) {
		
			position++;
			addText(yytext().substring(0,1));
			length = length-1;
		}
	
		yypushback(length);
		
		if(cutRightEdge) {
			length = length-1;
		}
		
		previousState = nextState;
		yybegin(nextState);	
	}
		
	private void readValue(int nextState) {
			
		annotationEntity.setPosition(position);
	
		String matchingText = yytext();
		
		offsetValue = 0;
		lengthValue = yylength();

		/* La rilevazione interna non deve superare i precedenti limiti */
		if( lengthValue > (length-offset) ) {
		
			lengthValue = length-offset;
			matchingText = matchingText.substring(0, lengthValue);
		}
		
		annotationEntity.setText(Util.removeAllAnnotations(matchingText));
		
		offset += lengthValue;
		position += lengthValue;
		
		yypushback(yylength());
		yybegin(nextState);	
	}
	


